import React from "react";
import styled from "styled-components";

const PageTitle = styled.h1`
  font-size: 2.86em;
  margin-bottom: 1em;
  font-weight: bold;
`;

const GameHeader = () => <PageTitle>Find the pairs</PageTitle>;

export default GameHeader;
